    "2013-03-14T19:27:37.553853",nt"name": "elf-owl-ds14",nt"isopen": false,nt"url":
    null,nt"notes": "This data set contains a database of all known positive observations
    of elf owls in California. This data set is a companion to Elf Owl Surveys which
    portrays the survey routes used in Department surveys in 1988-89 and 1998-99. This
    companion data set includes known negative observations, not only of sites known
    to have had elf owls, but of other areas of potentially suitable elf owl habitat.
    TIME PERIOD COVERED. The earliest observation record here dates from 1903 and the
    most recent from 2000. NUMBER OF RECORDS. This database includes 78 records, a few
    of which may cover a short period of time (no more than a couple of months). GEOGRAPHIC
    EXTENT OF THE RECORDS. These elf owl observations records come mostly from the California
    side of the Colorado River, from very close to the Nevada border south almost to
    the border with Mexico. Observations also have come from spring-like areas in the
    Sonoran Desert area west of Blythe and as far west as Joshua Tree National Monument.
    This area includes the eastern parts of San Bernardino, Riverside, and Imperial
    counties. BASE DATA STRUCTURE. The data set exists as a flat-file Access data table.
    WHAT EACH RECORD REPRESENTS. Each record contains the legal and UTM location of
    the observation, date and observer, number of owls found and if young were known
    to be present, and the source and/or affiliation of the observer.",nt"license_title":
